		//ממיר את השניות לדקות ושניות
		function secToMinAndSec() {
		
			var minutes = Math.floor(totalTime / 60);
			var seconds = totalTime - minutes * 60;
			var result = minutes + ":" + seconds;
			if (minutes > 0) {
				return result + " דקות"
		
			} else { // לקח פחות מדקה
				return result + " שניות"
			}
		
		}
		
		//מחשב את הניקוד עבור שאלה
		function calcScoreToAns(numTry) {
			return Math.ceil(100 / (tryList.length * numTry))
		}
		
		function totalScore() {
		
			var finalScore = 0;
			for (i = 0; i < tryList.length; i++) {
				finalScore += calcScoreToAns(tryList[i])
			}
			return finalScore;
		}
		
